import React from 'react';
import {Grid,Paper,Typography} from '@material-ui/core';


const VideoItem = ({video , handleVideoSelect,key}) => {

    if(!video)  return <div></div>
    const VideoSrc= `https://www.youtube.com/embed/${key}`

    return (
        <React.Fragment>
        <Grid item xs={12}>
            <Paper style={{display: 'flex', alighItems: 'center', cursor: 'pointer'}} >
            <iframe frameBorder="0"  height="100%" width="100%" title="video Player" src={VideoSrc}/>
            {/* <img style={{marginRight : '20px'}} alt="thumbnails" src={video.snippet.thumbnails.medium.url}/> */}

            <Typography variant="subtitle1"><b>{video.snippet.title}</b></Typography>
            </Paper>
       </Grid>
        </React.Fragment>

    )
};
export default VideoItem;
